import React from 'react';

function HeaderLink(props) {
  return (
      <li>
	      	<span className="tech-group"> {props.techGroup} </span>
	      	<ul>
            {props.techItems.map((value, index) => {
                return <li key={index}>{value}</li>
            })}
	      	</ul>
      </li>
  );
}

export default HeaderLink;
